import React from 'react';
import { NavLink } from 'react-router-dom';

function ButtonLinkNavigation (props){
    
    return(
        <React.Fragment>
           
                <div 
                        className={props.classname}
                        onClick={() => props.onclick()}
                        onMouseOver={(d) => props.onmouseover(d)}
                        onMouseLeave={() => props.onmouseleave()}
                        tabIndex={props.tabindex}
                >
                    <NavLink 
                            to={props.to}
                            exact={props.exact}
                    > 
                        {props.name}

                    </NavLink>

                    <NavigationLinkAbout
                            aboutLink={props.aboutLink}
                            classname={props.classnameLinkAbout}
                    />

                </div>

        </React.Fragment>
    )
}

export default ButtonLinkNavigation
